import axios from "axios";
import React, { useState, useEffect } from "react";

const Test = () => {
  let [test, testChange] = useState();

  const getData = async (state, setState) => {
    await axios.get("http://localhost:8181/sample/read").then((result) => {
      setState((result) => {
        return setState(result.data);
      });
    });
  };
};

export default Test;
